  [],\n\t\"revision_timestamp\": \"2015-11-20T09:12:58.728775\",\n\t\"name\": \"project-gate-growing-america-through-entrepreneurship-final-evaluation-dataset\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Project GATE was a random-assignment demonstration
  project designed to help public workforce system clients create, sustain or expand
  their own business. The cornerstone of the evaluation of Project GATE was random
  assignment. A total of 4,198 applicants to Project GATE were randomly assigned to
  either the program group or the control group. Members of the program group were
  offered GATE services; members of the control group were not. This dataset is the
  final data from the evaluation and includes administrative data from the six and
  eighteen month follow-ups and survey data from the six month, eighteen month, and
  sixty month follow-ups of program participants.\",\n\t\"license_title\": \"License
